import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Register from './pages/register';
import Login from './pages/login';
import './App.css';
import Gymbro from './pages/gymbro';

// Inside the <Routes> component
<Route path="/gymbro" element={<Gymbro />} />


function App() {
    return (
        <Router>
            <div className="landingBody">

                <img src="/ellipse.png" alt="Ellipse" className="ellipseImage" />


                <img src="/landimg.png" alt="Running Woman" className="runningWomanImage" />


                <div className="largeText">DUMBLE.</div>

                <nav className="landingNav">
                    <Link to="/">
                        <img
                            src="/logo192.png"
                            alt="logo"
                            className="App-logo"
                            width={50}
                            height={50}
                        />
                    </Link>

                    <div>
                        <Link to="/login" className="App-link">Login</Link>
                        <Link to="/register" className="App-link">Register</Link>
                    </div>
                </nav>

                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/" />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
